★　ストレスがたまりやすいから和らげる<br>「見やすい液晶表示に多彩な機能」というお客様の声をしっかり受け止めた、多彩な治療内容の低周波治療器が登場しました。つらい急な痛みに強いのは「すっきりコース」。低い低周波の刺激で、凝りや痺れなどを長時間掛けて、その名の通りじっくりとほぐしてくれます。コースも本格派の「ソフトモード」「繰り返しモード」「ポイント&ワイドモード」「バランス調節（赤＆白）」と使い分けOK。各種のモードを使い分ければしつこい疲れも芯からほぐしてくれる事間違いありません。<br><p class=spec>商品スペック</p><br><br>* パッド ： ロングライフパッド <br><br>* パッド枚数 ： 2枚 <br><br>* 温熱治療 ： 非対応 <br><br>* 部位別コース ： 4種類 <br><br>* もみ方コース ： 4種類 <br><br>* 強さ調節 ： 10段階 <br><br>* 電源 ： 単4形電池×2個<!-- 広告文責 START --><br /><br />【広告文責】株式会社MOA 03-6631-1125<br />【メーカー】オムロンヘルスケア株式会社<br />【区分】中国製・医療機器<br /><br /><img src=http://image.rakuten.co.jp/premoa/cabinet/common/overseas_impinfo.gif><!-- 広告文責 END --><!-- 共通説明文（大）-->
